import React from 'react';

function Contact(){
    return (
        <div id="contact" className="w-100 bg-dark py-3">
            <div className="container">
                <div className="w-100 text-center text-white my-2">
                    <h2>Contacto</h2>
                </div>
            </div>
        </div>
    )
}

export default Contact;
